import React, { useEffect, useState } from "react";
import styled from "styled-components";
import { useNavigate, useLocation } from "react-router-dom";

// Componentes de layout reutilizados
const Aside = styled.aside`
  width: 200px;
  background: #3b0a0a;
  color: white;
  padding: 1rem;
`;

const SidebarItem = styled.div`
  font-weight: bold;
  background: ${(props) => (props.$active ? "#000" : "#3b0a0a")};
  padding: 0.5rem;
  border-radius: 5px;
  cursor: pointer;
  transition: background 0.3s;
  margin-bottom: 1rem;

  &:hover {
    background: #8b0000;
  }
`;

const SidebarMenu = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const Conteudo = styled.div`
  position: relative;
  z-index: 2;
  height: 100vh;
  display: flex;
`;

const LinhaTitulo = styled.div`
  width: 100%;
  height: 4px;
  background: linear-gradient(to right, #ffffff, #888888);
  margin-top: 0.5rem;
  margin-bottom: 1.5rem;
  border-radius: 2px;
`;

export default function Clientes() {
  const navigate = useNavigate();
  const location = useLocation();

  // Estado para simular os dados vindos do backend
  const [clientes, setClientes] = useState([]);
  const [clienteSelecionado, setClienteSelecionado] = useState(null);

  useEffect(() => {
    // Simulação de dados
    const dadosMock = [
      {
        id: 1,
        nome: "João",
        pedidos: [
          { id: 101, itens: [{ nome: "Temaki", quantidade: 2 }, { nome: "Sushi", quantidade: 4 }] },
          { id: 102, itens: [{ nome: "Yakissoba", quantidade: 1 }] }
        ]
      },
      {
        id: 2,
        nome: "Maria",
        pedidos: [
          { id: 201, itens: [{ nome: "Sashimi", quantidade: 3 }] }
        ]
      }
    ];
    setClientes(dadosMock);
  }, []);

  return (
    <Conteudo>
      <Aside>
        <div style={{ textAlign: "center", marginBottom: "1rem" }}>
          <img src="/MaleUser.svg" alt="Perfil" style={{ width: "60px" }} />
        </div>
        <SidebarMenu>
          <SidebarItem $active={location.pathname === "/clientes"} onClick={() => navigate("/clientes")}>
            Clientes
          </SidebarItem>
        </SidebarMenu>
      </Aside>

      <main style={{ flex: 1, padding: "2rem", background: "#4a4a4a", color: "white" }}>
        <h2>Clientes</h2>
        <LinhaTitulo />

        <select
          style={{ padding: "0.5rem", marginBottom: "1.5rem" }}
          onChange={(e) =>
            setClienteSelecionado(clientes.find(c => c.id === parseInt(e.target.value)))
          }
        >
          <option value="">Selecione um cliente</option>
          {clientes.map((c) => (
            <option key={c.id} value={c.id}>
              {c.nome}
            </option>
          ))}
        </select>

        {clienteSelecionado && (
          <div>
            <h3>Histórico de pedidos:</h3>
            {clienteSelecionado.pedidos.map((pedido, index) => (
              <div key={pedido.id} style={{ marginBottom: "1rem" }}>
                <strong>Pedido {index + 1}</strong>
                {pedido.itens.map((item, i) => (
                  <div key={i} style={{ display: "flex", gap: "1rem", marginLeft: "1rem" }}>
                    <span>{item.nome}</span>
                    <input value={item.quantidade} readOnly style={{ width: "40px" }} />
                  </div>
                ))}
              </div>
            ))}
          </div>
        )}
      </main>
    </Conteudo>
  );
}
